import Format from '../../components/format/format.component'
import './select-format.styles.scss'
class SelectFormat extends React.Component{
    constructor() {
        super();
        this.state = {
            formats :[
                ['QB','RB1','RB2','WR1','WR2','TE','Flex','K','DEF'],
                ['QB','RB1','RB2','WR1','WR2','WR3','TE','Flex','K','DEF'],
                ['QB','RB1','RB2','WR1','WR2','TE','Flex','Flex2','K','DEF'],
                ['QB1','QB2','RB1','RB2','WR1','WR2','TE','Flex','K','DEF']
            ]
          };
    }
    render(){

    return(
        <div className='select-format'>
        <h1>Select the format of your league</h1>
        <div className = 'formats' >
           { this.state.formats.map(format=><Format positions = {format} />)}
           </div>
        </div>
    )
    }
}

export default SelectFormat
